import { Col, Container, Row } from 'react-bootstrap';
import Img from './Img';

function DarkVariantExample() {
  return (
    <Container>
     <h2 className="mb-5 mt-2" style={{ textAlign: "center" }}>MY PROJECT DESIGNS</h2>
      <Row className="align-items-center mt-5">
     {
      Img.map((val)=>{
      return(  <Col className='border border-secondary-subtle'>
        <img src={val.url} style={{maxWidth:"250px"}} className='h12'/>
        </Col>)
      })
     }
      </Row>


    </Container>
  );
}

export default DarkVariantExample;
